import React from "react";
import styles from "./UserHomePage.module.css";
import { Search } from "../Search/Search";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

function UserHeader({user}) {
    return(
        <div className={styles.user_homepage_header}>
            <div className={styles.user_homepage_header_name}>
                <p>{user.name}</p>
                <FontAwesomeIcon icon="fa-solid fa-caret-down" />
            </div>
        </div>
    );
}

function UserHomePage({user}) {
    const { id, name, balance, lastname, email } = user; /* No olvidarse de eliminar el envio del password */
    return(
        <div className={styles.UserHomePage}>
            <UserHeader user={user} />
            <Search />
            {/* <QrButton /> */}
        </div>
    );
}

export default UserHomePage;
